import React, { useEffect, useState } from "react";
import api from "../api/axios";
import { Link } from "react-router-dom";
import "./Ayurveda.css";

export default function Ayurveda() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchAyurvedicProducts = async () => {
      try {
        const res = await api.get("/medicines/category", {
          params: { type: "ayurveda" },
        });
        setProducts(res.data || []);
      } catch (err) {
        console.error("❌ Error fetching Ayurveda products:", err.message);
        setProducts([]);
      } finally {
        setLoading(false);
      }
    };

    fetchAyurvedicProducts();
  }, []);

  const renderProductCard = (item, style = "solid") => (
    <div key={item._id} className="product-card">
      <img
        src={item.image || "/images/default-product.png"}
        alt={item.name}
        className="product-image"
      />
      <h5 className="product-name">{item.name}</h5>
      <p className="product-price">₹{item.price}</p>
      <button className={`btn ${style === "solid" ? "btn-success" : "btn-outline-success"}`}>
        Add
      </button>
    </div>
  );

  return (
    <div className="ayurveda-store">
      {/* 🌿 Banner */}
      <div className="banner">
        <div className="banner-content">
          <h1>MediQ Ayurvedic Store</h1>
          <p>Rooted in Kerala’s healing traditions</p>
        </div>
      </div>

      {/* 🧪 Top Ayurvedic Treasures */}
      <section className="section">
        <h2 className="section-title">Top Ayurvedic Treasures</h2>
        <div className="product-grid">
          {products.slice(0, 6).map((item) => renderProductCard(item))}
        </div>
      </section>

      {/* 🧘‍♀️ Specialty Picks */}
      <section className="section specialty">
        <h2 className="section-title">Specialty Ayurvedic Picks</h2>
        <div className="product-grid">
          {products.slice(6, 12).map((item) => renderProductCard(item, "outline"))}
        </div>
      </section>

      {/* 🥤 Juices for Wellness */}
      <section className="section juices">
        <h2 className="section-title">Juices for Wellness</h2>
        <div className="product-grid">
          {products
            .filter((p) => p.name.toLowerCase().includes("juice"))
            .map((item) => renderProductCard(item, "outline"))}
        </div>
      </section>

      {/* 🧭 Shop by Category */}
      <section className="section categories">
        <h2 className="section-title">Shop by Category</h2>
        <div className="category-grid">
          {["Ayurveda", "Homeopathy", "Unani", "Siddha"].map((cat) => (
            <div key={cat} className="category-tile">
              <img
                src={`/images/categories/${cat.toLowerCase()}.png`}
                alt={cat}
                className="category-image"
              />
              <h5>{cat}</h5>
            </div>
          ))}
        </div>
      </section>

      {/* 📚 Blog Previews */}
      <section className="section blog">
        <h2 className="section-title">Ayurvedic Home Remedies</h2>
        <div className="blog-grid">
          {["Amla Benefits", "Stress Relief", "Herbal Cleansing", "Skin Tips"].map((title, idx) => (
            <div key={idx} className="blog-card">
              <img
                src={`/images/blogs/blog${idx + 1}.jpg`}
                alt={title}
                className="blog-image"
              />
              <h5>{title}</h5>
              <p>Explore traditional remedies and wellness tips.</p>
              <Link to="/blog" className="btn btn-sm btn-outline-success">
                Read More
              </Link>
            </div>
          ))}
        </div>
      </section>

      {/* 🦶 Footer */}
      <footer className="footer mt-5">
        <div className="footer-links">
          <div>
            <h6>Company</h6>
            <p>About MediQ</p>
            <p>Pharmacists</p>
            <p>Certificates</p>
          </div>
          <div>
            <h6>Policies</h6>
            <p>Terms & Conditions</p>
            <p>Privacy Policy</p>
            <p>Refund Policy</p>
          </div>
          <div>
            <h6>Connect</h6>
            <p>Facebook</p>
            <p>Instagram</p>
            <p>LinkedIn</p>
          </div>
        </div>
        <p className="text-center mt-3">© MediQ 2025 MediQ Marketplace Ltd.</p>
      </footer>
    </div>
  );
}
